import React, { Component } from 'react';
import { Text, Div, Image} from "atomize";
import gif1 from './gif/1.gif'
import gif2 from './gif/2.gif'
import gif3 from './gif/1.gif'
import gif4 from './gif/1.gif'
import gif5 from './gif/1.gif'
import gif6 from './gif/1.gif'




class GIF extends React.Component {

    render() { 

        return (
            <Div
                d="flex"
                m={{ b: "40px" }}
            >
                <Image src={gif1} rounded="xl" />
            </Div>
            )
    }
}

export default GIF;
